// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "./IotaHeroAccount.sol";
import "./IotaHeroGameTokens.sol";

contract IotaHeroFactory is ERC721, Ownable, IotaHeroAccount {
    constructor() ERC721("IotaHero", "IH") {}

    using SafeMath for uint256;
    address[] statManipulators;

    uint256 heroIdCounter = 0;
    struct Hero {
        uint256 id;
        uint256 dna;
        uint256 constitution;
        uint256 strength;
        uint256 agility;
        uint256 intelligence;
        string name;
    }

    Hero[] public heroes;

    mapping(address => bool) isStatManipulator;

    modifier onlyStatManipulators() {
        require(isStatManipulator[msg.sender] == true);
        _;
    }
    modifier onlyOwnerOf(uint256 _heroId) {
        require(msg.sender == ERC721.ownerOf(_heroId));
        _;
    }
    modifier nameValidLength(string memory _name) {
        uint256 stringLength = utfStringLength(_name);
        require(
            stringLength < 13 && stringLength > 2,
            "The hero name must be between 3 and 12 characters"
        );
        _;
    }

    function addStatManipulator(address statManipulator) external onlyOwner {
        isStatManipulator[statManipulator] = true;
    }

    function removeStatManipulator(address statManipulator) external onlyOwner {
        isStatManipulator[statManipulator] = false;
    }

    function nameChange(uint256 _heroId, string memory _name)
        public
        hasAccount
        onlyOwnerOf(_heroId)
        nameValidLength(_name)
    {
        Hero storage hero = heroes[_heroId];
        hero.name = _name;
    }

    function _pseudoRandom(uint256 nonce) internal view returns (uint256) {
        uint256 psrand = uint256(
            keccak256(abi.encodePacked(block.timestamp + nonce))
        );
        return psrand % 10**12;
    }

    event HeroMinted(address indexed owner, uint256 id, uint256 dna);

    function _mintHero(uint256 _dna) internal {
        Hero memory hero = Hero(heroIdCounter, _dna, 20, 10, 10, 10, "");
        heroes.push(hero);
        _safeMint(msg.sender, heroIdCounter);
        emit HeroMinted(msg.sender, heroIdCounter, _dna);
        heroIdCounter = heroIdCounter.add(1);
    }

    function spawnHero() external hasAccount {
        uint256 dna = _pseudoRandom(heroIdCounter);
        _mintHero(dna);
    }

    function skillUp(
        uint256 _heroId,
        uint256 cons,
        uint256 str,
        uint256 agi,
        uint256 intel
    ) external onlyStatManipulators {
        Hero storage hero = heroes[_heroId];
        hero.constitution = hero.constitution.add(cons);
        hero.strength = hero.strength.add(str);
        hero.agility = hero.agility.add(agi);
        hero.intelligence = hero.intelligence.add(intel);
    }

    function withdraw() external payable onlyOwner {
        address payable _owner = payable(owner());
        _owner.transfer(address(this).balance);
    }

    function getHeroes() external view returns (Hero[] memory) {
        return heroes;
    }

    function getOwnerHeroes(address _owner)
        external
        view
        returns (Hero[] memory)
    {
        Hero[] memory ownedHeroes = new Hero[](balanceOf(_owner));
        uint256 c;
        for (uint256 i = 0; i < heroes.length; i++) {
            if (ownerOf(i) == _owner) {
                ownedHeroes[c] = heroes[i];
                c++;
            }
        }
        return ownedHeroes;
    }
}
